import Link from 'next/link'

const Stuff = () => {

  const style = {
    marginLeft: 10
  }
  return(
    <div>
      <p style={style}>This is some stuff...</p>
      <Link href="/index">
        <a>Back to the Index...</a>
      </Link>
    </div>
  )
}

export default Stuff;
